splReusable.libs.SapSplModelFormatters.getIsEnabledForFromSelectControl=function(i,a){return(i&&a);};
splReusable.libs.SapSplModelFormatters.formattingForNotifications=function(r,E,d,D){try{if(r!==undefined&&r!==null&&E!==undefined&&E!==null){if(E==="vehicles"){switch(r){case 0:return oSapSplUtils.getBundle().getText("TRUCK_NO_DEVICE",[d,D]);case 1:return oSapSplUtils.getBundle().getText("TRUCK_CANNOT_ASSIGN_DEVICE",[d,D]);case 2:return oSapSplUtils.getBundle().getText("TRUCK_DEVICE_ASSIGNED",[d,D]);case 3:return oSapSplUtils.getBundle().getText("DEVICE_PENDING",[d,D]);default:return oSapSplUtils.getBundle().getText("TRUCK_CANNOT_ASSIGN_DEVICE",[d,D]);}}else if(E==="myBusinessPartners"){switch(r){case 1:return oSapSplUtils.getBundle().getText("CUSTOMER_ACC_FAILED",[d]);case 2:return oSapSplUtils.getBundle().getText("CUSTOMER_ACC_CREATED",[d]);case 3:return oSapSplUtils.getBundle().getText("CUSTOMER_ACC_PROGRESS",[d]);default:return oSapSplUtils.getBundle().getText("CUSTOMER_ACC_FAILED",[d]);}}}else{throw Error();}}catch(e){jQuery.sap.log.error("SAP SCL Model Formatter","ReplicationStatus is not in String format. Error: "+e.message,"SAPSCL");}};
splReusable.libs.SapSplModelFormatters.setErrorCLassForSelectControl=function(f){if(f){this.addStyleClass("sapSnlhRedBorder");}else{this.removeStyleClass("sapSnlhRedBorder");}return true;};
splReusable.libs.SapSplModelFormatters.getThresholdDetailTextVisibility=function(i){if(i!==undefined&&i!==null&&i.constructor===Boolean){if(i){return false;}else{return true;}}else{return true;}};
splReusable.libs.SapSplModelFormatters.getThresholdText=function(k){if(k!==undefined&&k!==null&&k.constructor===String){var i=this.getParent().getParent().getParent().getParent().getParent().getParent().getParent().getParent().getParent().getController().getIndexOfkeyFromThresholdArray(k);return this.getParent().getParent().getParent().getParent().getParent().getParent().getParent().getParent().getParent().getController().thresholdArray[i].value;}else{return"";}};
splReusable.libs.SapSplModelFormatters.CanViewTrackingStatusLink=function(i,t,c){if(i==="1"&&splReusable.libs.SapSplModelFormatters.getVisibilityBasedOnType(t)&&c!==1){return true;}else{return false;}};
splReusable.libs.SapSplModelFormatters.returnTrackingStatusText=function(s){s=s.toString();if(s==="0"){this.addStyleClass("grayColor");return oSapSplUtils.getBundle().getText("RADAR_GEOFENCE_STATUS_PENDING");}else if(s==="1"){this.addStyleClass("greenColor");return oSapSplUtils.getBundle().getText("RADAR_GEOFENCE_STATUS_ACCEPTED");}else if(s==="2"){this.addStyleClass("redColor");return oSapSplUtils.getBundle().getText("RADAR_GEOFENCE_STATUS_REJECTED");}};
splReusable.libs.SapSplModelFormatters.setSelectedForLeftPanelGroupingList=function(f,s){try{if(f!==undefined&&f!==null&&f.constructor===String&&s!==undefined&&s!==null&&s.constructor===String){return(f===s);}else{throw Error();}}catch(e){jQuery.sap.log.error("SAP SCL Model Formatter","fieldName or sorterField is not in String format. Error: "+e.message,"SAPSCL");}};
splReusable.libs.SapSplModelFormatters.setVisiblePropertyForAcceptButton=function(R){try{if(R!==undefined&&R!==null&&R.constructor===String){return(R==="0");}else{return false;}}catch(e){jQuery.sap.log.error("SAP SCL Model Formatter","RequestStatus is not in String format. Error: "+e.message,"SAPSCL");}};
splReusable.libs.SapSplModelFormatters.setVisiblePropertyForRejectButton=function(R){try{if(R!==undefined&&R!==null&&R.constructor===String){return(R==="0"||R==="1");}else{return false;}}catch(e){jQuery.sap.log.error("SAP SCL Model Formatter","RequestStatus is not in String format. Error: "+e.message,"SAPSCL");}};
splReusable.libs.SapSplModelFormatters.setVisiblePropertyForRepostButton=function(R){try{if(R!==undefined&&R!==null&&R.constructor===String){if(R==="0"){this.removeStyleClass("sapSnlhIconRepostReject");this.addStyleClass("sapSnlhIconRepostActiceAndReject");}else{this.removeStyleClass("sapSnlhIconRepostActiceAndReject");this.addStyleClass("sapSnlhIconRepostReject");}return true;}else{return false;}}catch(e){jQuery.sap.log.error("SAP SCL Model Formatter","RequestStatus is not in String format. Error: "+e.message,"SAPSCL");}};
splReusable.libs.SapSplModelFormatters.setVisibleForNewLabel=function(R){try{if(R!==undefined&&R!==null&&R.constructor===String){if(R==="0"){this.setText(oSapSplUtils.getBundle().getText("NEW"));}else{this.setText("");}}else{this.setText("");}return true;}catch(e){jQuery.sap.log.error("SAP SCL Model Formatter","RequestStatus is not in String format. Error: "+e.message,"SAPSCL");}};
splReusable.libs.SapSplModelFormatters.getDeltaValueShowStatus=function(t){if(t-100==0){return false;}else{return true;}};
splReusable.libs.SapSplModelFormatters.getTATIndexforStringToInteger=function(t){return parseInt(t,10);};
splReusable.libs.SapSplModelFormatters.getColorForTATIndex=function(t){if(t<100){return"Good";}else if(t>100){return"Error";}};
splReusable.libs.SapSplModelFormatters.getStopStatusVisibilityBasedOnStatus=function(s){try{if(s!==undefined&&s!==null&&s.constructor===String){if(s==="C"){return true;}else{return false;}}else{throw Error();}}catch(e){if(e.constructor===Error()){jQuery.sap.log.error("SAP SCL Model Formatter","tourStatus is not in String format. Error: "+e.message,"SAPSCL");}}};
splReusable.libs.SapSplModelFormatters.getActualValueForToolTip=function(t){var c="";var s="";if(t<100){c=oSapSplUtils.getBundle().getText("COLORGOOD");}else if(t>100){c=oSapSplUtils.getBundle().getText("COLORERROR");}if(t===null||t===undefined){s=oSapSplUtils.getBundle().getText("ACTUAL")+" "+oSapSplUtils.getBundle().getText("TATNULL_TOOLTIP")+"\n((AltText))";}else{s=oSapSplUtils.getBundle().getText("ACTUAL")+" "+t+"% "+c+"\n((AltText))";}return s;};
splReusable.libs.SapSplModelFormatters.setVisiblePropertyForOrderIdDestinationInfo=function(i,m,I){if(I===undefined||I===null){I=parseInt(this.getBindingContext().sPath.split("/")[2],10);}try{if(i!==undefined&&i!==null&&i.constructor===Number&&m!==undefined&&m!==null&&m.constructor===Array){if((m[i].items[I].Action==="P"||m[i].items[I].Action==="D")){return true;}else{return false;}}else{return false;}}catch(e){if(e.constructor===Error()){jQuery.sap.log.error("SAP SCL Model Formatter","tourStatus is not in String format. Error: "+e.message,"SAPSCL");}}};
splReusable.libs.SapSplModelFormatters.enablePartnerIDInput=function(t){if(t!==undefined||t!==null){if(t==="LC0003"){return true;}else{return false;}}else{return false;}};
splReusable.libs.SapSplModelFormatters.fnCanEditBupaDetails=function(v,s,c){try{if(s){if(v===1){if(c===1){return true;}else{return false;}}else{return false;}}else{return false;}}catch(e){if(e.constructor===Error()){jQuery.sap.log.error(e.message,"sValue Type is not Number","SapSplModelFormatters.js");}}};
splReusable.libs.SapSplModelFormatters.fnGetTourStopActionText=function(v){if(v==="D"){return oSapSplUtils.getBundle().getText("FREIGHT_ITEM_ASSIGN_DROP");}else if(v==="P"){return oSapSplUtils.getBundle().getText("FREIGHT_ITEM_ASSIGN_PICK_UP");}else{return oSapSplUtils.getBundle().getText("FREIGHT_ITEM_ASSIGN_DO_NOTHING");}};
splReusable.libs.SapSplModelFormatters.enableNewOrEditStopInTours=function(s){if(s!==undefined&&s!==null){if(s===oSapSplUtils.getCompanyDetails().UUID){return true;}else{return false;}}else{return true;}};
splReusable.libs.SapSplModelFormatters.setNoDataTextForTrackGeofenceDialogList=function(g){if(g!==undefined&&g!==null&&g.constructor===String){return oSapSplUtils.getBundle().getText("NO_DATA_TEXT_GEOFENCE_ALREADY_REJECTED",g);}};
splReusable.libs.SapSplModelFormatters.enableEditStopLinkForStopsInTour=function(i){if(i!==undefined&&i!==null&&i.constructor===String){return(i==="1");}};
splReusable.libs.SapSplModelFormatters.setVisibilityofExternalID=function(c){if(c===0){return false;}else{return true;}};
